import React from 'react'
import PostMain from './PostMain'
import PostSideBar from './PostSidebar'
class PostComponent extends React.Component{
    render(){
        const style={
            display: 'grid',
            gridTemplateColumns: '70% 30%',
            margin: '0px 5%',
        }
        return(
            <main style={style}>
                <PostMain />
                <div style={{position: 'fixed', right: '0px', marginTop: '80px', marginRight: '20px', minWidth: '380px', maxWidth: '380px'}}>
                <PostSideBar />
                </div>
            </main>
        )
    }
}

export default PostComponent
